        imageSrc="https://cdn.pixabay.com/photo/2016/11/23/00/58/record-player-1851576_1280.jpg"
        followersCount={100}
        title="New Bollywood"
      />
      <Card
        imageSrc="https://cdn.pixabay.com/photo/2016/11/23/00/58/record-player-1851576_1280.jpg"
        followersCount={100}
        title="New Bollywood"
      />
    </div>
  );
}
